import React from "react";
import { styled } from "~/stitches.config";

const Title = styled("h1", {
  color: "green",
  backgroundColor: "yellow",
  ":hover": {
    color: "red",
  },
});

export default function Main() {
  return <Title>Hello world</Title>;
}
